<script>
(async () => {
    const topology = await fetch(
        "https://code.highcharts.com/mapdata/custom/world-highres.topo.json"
    ).then((response) => response.json());

    // Obtenemos el elemento input
    const input = document.getElementById('json-destinos');
    
    // Extraemos el valor del input (que es un string en formato JSON)
    const jsonString = input.value;
    
    // Parseamos el string a objeto JavaScript
    const data = JSON.parse(jsonString);
    
    console.log(data); // Aquí puedes ver el resultado en la consola

    let lastSelectedPoint = null;

    Highcharts.mapChart("container", {
        chart: {
            map: topology,
            spacing: [2, 4, 15, 4],
            height: null,
            width: null,
            borderWidth: 1,
            borderColor: "#B8C8F3",
            borderRadius: 15,
            backgroundColor: "#FBFCFF",
        },

        title: {
            text: "",
        },
        legend: {
            enabled: false,
        },
        // mapView: {
        // 	zoom: 1.6, // Nivel de zoom inicial
        // 	center: [-15, 0], // Coordenadas para centrar el mapa
        // },
        mapNavigation: {
            enabled: true,
            buttonOptions: {
                align: "left",
                verticalAlign: "bottom",
                x: 10,
            },
        },

        colorAxis: {
            min: 0,
            max: 1,
            stops: [
                [0, "#A5D6A7"],
                [1, "#074DFF1A"],
            ],
        },
        exporting: {
            enabled: false,
        },
        tooltip: {
            useHTML: true,
            formatter: function() {
                return this.point ?
                    `<b>${this.point.name}</b><br> ${this.point.options.info}` :
                    "";
            },
        },
        series: [{
                data: data, // Asegúrate de definir 'data'
                name: "País",
                nullColor: "#074DFF1A",
                borderColor: "#FFFFFF",
                borderWidth: 2,
                borderRadius: 15,
                states: {
                    hover: {
                        color: "#99B0EB",
                        borderWidth: 1,
                        borderColor: "#FFFFFF",
                    },
                    inactive: {
                        enabled: false, // Desactiva el efecto de opacidad
                    },
                },
                dataLabels: {
                    enabled: false,
                },
                joinBy: ["hc-key", "key"],
                point: {
                    events: {
                        select: function() {
                            if (lastSelectedPoint) {
                                lastSelectedPoint.select(
                                    false); // Deseleccionar el punto anterior
                            }
                            lastSelectedPoint = this; // Guardar el punto seleccionado
                            this.series.chart.tooltip.refresh(this); // Mostrar el tooltip
                        },
                        unselect: function() {
                            lastSelectedPoint =
                                null; // Limpiar la referencia al punto seleccionado
                            this.series.chart.tooltip.hide(); // Ocultar el tooltip
                        },
                    },
                },
            },
            {
                type: "mappoint",
                name: "Frutas",
                data: data.map((d) => ({
                    name: d.name,
                    lat: d.lat,
                    lon: d.lon,
                    info: d
                        .info, // Asegúrate de incluir la información que deseas mostrar
                })),
                marker: {
                    symbol: "url(<?php echo get_template_directory_uri(); ?>/img/marcador-icon.svg)",
                    width: 30,
                    height: 30,
                },
                dataLabels: {
                    enabled: false, // Desactivar las etiquetas de datos para los marcadores
                },
                point: {
                    events: {
                        mouseOver: function() {
                            this.series.chart.tooltip.refresh(
                                this); // Mostrar el tooltip sin ocultar el mapa
                        },
                        mouseOut: function() {
                            this.series.chart.tooltip.hide(); // Ocultar el tooltip
                        },
                        select: function() {
                            if (lastSelectedPoint) {
                                lastSelectedPoint.select(
                                    false); // Deseleccionar el punto anterior
                            }
                            lastSelectedPoint = this; // Guardar el punto seleccionado
                            this.series.chart.tooltip.refresh(this); // Mostrar el tooltip
                        },
                        unselect: function() {
                            lastSelectedPoint =
                                null; // Limpiar la referencia al punto seleccionado
                            this.series.chart.tooltip.hide(); // Ocultar el tooltip
                        },
                    },
                },
            },
        ],
        responsive: {
            rules: [{
                condition: {
                    maxWidth: 640, // Ajusta el ancho máximo según tus necesidades
                },
                chartOptions: {
                    mapView: {
                        zoom: 2.6, // Nivel de zoom inicial
                        center: [-80, 25], // Coordenadas para centrar el mapa
                    },
                },
            }, ],
        },
    });
})();
